import React, { useState } from "react";
import {
  Typography,
  Grid,
  Tabs,
  Tab,
  Paper,
  Menu,
  MenuItem,
  Button
} from "@material-ui/core";
import * as Icons from "@material-ui/icons";

// styles
import useStyles from "./styles";

// components
import PageTitle from "../../components/PageTitle/PageTitle";


// icons sets
import "font-awesome/css/font-awesome.min.css";

export default function IconsPage () {
  const [anchorEl, setAnchorEl] = React.useState(null)

  const handleClick = (e) => {
    setAnchorEl(e.currentTarget)
  }

  const handleClose = () => {
    setAnchorEl(null)
  }

  var classes = useStyles();

  // local
  var [activeTabId, setActiveTabId] = useState(0);

  return (
  <>
    <PageTitle title="Kidney Testing" button={(
      <>
        <Button
      variant="contained"
      size="medium"
      color="secondary"
      onClick={e => handleClick(e)}
    >
      Download Results
    </Button>
        <Menu
      id="simple-menu"
      anchorEl={anchorEl}
      keepMounted
      open={Boolean(anchorEl)}
      onClose={handleClose}
    >
      <MenuItem onClick={handleClose}><Icons.Print style={{marginRight: 16}}/> Print PDF</MenuItem>
      <MenuItem onClick={handleClose}><Icons.GetApp style={{marginRight: 16}}/> Download</MenuItem>
      <MenuItem onClick={handleClose}><Icons.Email style={{marginRight: 16}}/>Send by mail</MenuItem>
          <MenuItem onClick={handleClose}><Icons.Share style={{marginRight: 16}}/>Share</MenuItem>
    </Menu>
      </>
    )} />
    <Paper className={classes.iconsContainer}>

      {activeTabId === 0 && (
        <div>
          <Grid container spacing={2} className="icon-list">
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AccessAlarm />
              <Typography className={classes.materialIconText}>
                AccessAlarm
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AccessAlarms />
              <Typography className={classes.materialIconText}>
                AccessAlarms
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.Accessibility />
              <Typography className={classes.materialIconText}>
                Accessibility
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.Accessible />
              <Typography className={classes.materialIconText}>
                Accessible
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AccessibleForward />
              <Typography className={classes.materialIconText}>
                AccessibleForward
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AccessTime />
              <Typography className={classes.materialIconText}>
                AccessTime
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AccountBalance />
              <Typography className={classes.materialIconText}>
                AccountBalance
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AccountBalanceWallet />
              <Typography className={classes.materialIconText}>
                AccountBalanceWallet
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AccountBox />
              <Typography className={classes.materialIconText}>
                AccountBox
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AccountCircle />
              <Typography className={classes.materialIconText}>
                AccountCircle
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AcUnit />
              <Typography className={classes.materialIconText}>
                AcUnit
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.Adb />
              <Typography className={classes.materialIconText}>Adb</Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.Adjust />
