                Adjust
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirlineSeatFlat />
              <Typography className={classes.materialIconText}>
                AirlineSeatFlat
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirlineSeatFlatAngled />
              <Typography className={classes.materialIconText}>
                AirlineSeatFlatAngled
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirlineSeatIndividualSuite />
              <Typography className={classes.materialIconText}>
                AirlineSeatIndividualSuite
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirlineSeatLegroomExtra />
              <Typography className={classes.materialIconText}>
                AirlineSeatLegroomExtra
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirlineSeatLegroomNormal />
              <Typography className={classes.materialIconText}>
                AirlineSeatLegroomNormal
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirlineSeatLegroomReduced />
              <Typography className={classes.materialIconText}>
                AirlineSeatLegroomReduced
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirlineSeatReclineExtra />
              <Typography className={classes.materialIconText}>
                AirlineSeatReclineExtra
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirlineSeatReclineNormal />
              <Typography className={classes.materialIconText}>
                AirlineSeatReclineNormal
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirplanemodeActive />
              <Typography className={classes.materialIconText}>
                AirplanemodeActive
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirplanemodeInactive />
              <Typography className={classes.materialIconText}>
                AirplanemodeInactive
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.Airplay />
              <Typography className={classes.materialIconText}>
                Airplay
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirportShuttle />
              <Typography className={classes.materialIconText}>
                AirportShuttle
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.Alarm />
              <Typography className={classes.materialIconText}>
                Alarm
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.Album />
              <Typography className={classes.materialIconText}>
                Album
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AllInbox />
              <Typography className={classes.materialIconText}>
                AllInbox
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AllInclusive />
              <Typography className={classes.materialIconText}>
                AllInclusive
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AllOut />
              <Typography className={classes.materialIconText}>
                AllOut
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AlternateEmail />
              <Typography className={classes.materialIconText}>
                AlternateEmail
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.Android />
              <Typography className={classes.materialIconText}>
                Android
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.Announcement />
