                Announcement
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.Apps />
              <Typography className={classes.materialIconText}>Apps</Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.Archive />
